import React from 'react';
import {Signup} from "./components/signup";

function App() {
  return (
      <div className="container">
        <div className="row">
          <div className="col-md-1">
            <img
                src="https://c0.wallpaperflare.com/preview/118/10/323/business-establishing-a-business-startup-target.jpg"
                alt=""
                width="100%"
            />
          </div>
          <div className="col-md-4">
            <Signup/>
          </div>
        </div>
      </div>
  );
}

export default App;
